    false,nt"url": null,nt"notes": "This polygon feature class represents vegetation
    communities mapped at Pipe Spring National Monument. The polygons were delineated
    using guidelines set by the USGS-NPS Vegetation Mapping Program (http://biology.usgs.gov/npsveg/standards.html).
    The vegetation map unit lines were drawn onscreen using the digital orthophotos
    available of the project area (collected May of 2006). The line work was cleaned,
    polygons created then attributed. As with any digital layer, this layer is a representation
    of what is actually occurring on the ground; errors are inherent in any interpretation
    of ground qualities. Due to the "snapshot" nature of the aerial photography, this
    vegetation layer largely reflects conditions that existed when the imagery was collected.",nt"license_title":
